sources.styles\\reset.less:
*,
*::before,
*::after {
    box-sizing: border-box;
}

ul[class],
ol[class] {
  padding: 0;
}

body,
h1,
h2,
h3,
h4,
h5,
p,
ul[class],
ol[class],
li,
figure,
figcaption,
blockquote,
dl,
dd {
  margin: 0;
}

ul,
ol {
  list-style: none;
}

a:not([class]) {
  text-decoration-skip-ink: auto;
}

img {
  max-width: 100%;
  display: block;
}

article > * + * {
  margin-top: 1em;
}

input,
button,
textarea,
select {
  font: inherit;
}

sources.styles\\all-devices.less:
.devices{
    background-image: url('../images/devices-bg.png');
    background-repeat:no-repeat;
    background-size: cover;
    &__shadow{
        background-color:rgba(255, 255, 255, 0.8);
    }
    &__container{
        max-width: 1170px;
        margin: 0 auto;
    }
    &__wrapper{
        padding-top: 42px;
        padding-bottom: 58px;
        margin: 0 15px;
        @media screen and (max-width:1024px){
            padding-top: 32px;
            padding-bottom: 38px;
        }
    }
    .title-centr{
        .pure-line{
            margin-top: 24px;
            margin-bottom: 60px;
            @media screen and (max-width:1024px){
                margin-top: 20px;
                margin-bottom: 40px;
            }
        }
    }
    &__img-exampl{
        max-width: 680px;
        min-height: 520px;
        margin: 0 auto;
        position: relative;
        @media screen and (max-width:1024px){
            max-width: 550px;
            min-height: 420px;
        }
        @media screen and (max-width:700px){
            max-width: 550px;
            min-height: 420px;
        }        
        @media screen and (max-width:520px){
            min-height: 320px;
        }  
        @media screen and (max-width:400px){
            min-height: 320px;
        }
        .device__note{            
            .device__mobile{
                position:absolute;
                z-index: 3;
                right: -10%;
                top: 40%;
                @media screen and (max-width:1024px){
                    max-width: 140px;
                    min-height: 200px;
                    top: 50%;
                }
                @media screen and (max-width:700px){
                    max-width: 120px;
                    min-height: 180px;
                    top: 60%;                    
                    right: 10%;
                    transition: 0.3s;
                }        
                @media screen and (max-width:520px){
                    max-width: 100px;
                    min-height: 160px;
                    top: 50%;                    
                    right: 10%;
                }  
                @media screen and (max-width:400px){
                    max-width: 86px;
                    min-height: 160px;
                    top: 30%;                    
                    right: 10%;
                }   
            }
            .device__ramka{                
                position: absolute;                
                z-index: 2; 
            }
            .device__note-bg{
                width: 100%;
                height: 100%;
                position: absolute;
                margin-top: 2px;
                padding: 20px;
                z-index: 1;   
                @media screen and (max-width:700px){
                  padding: 8px;
                }                
            }

        }
    }
}

sources.styles\\amazing-services.less:
.amazing{
    background-color: #FFFFFF;
    &__container{
        max-width: 1170px;
        margin: 0 auto;
    }
    &__wrapper{
        margin: 0 15px;
        padding-top: 42px;
        padding-bottom: 90px;
        @media screen and (max-width:1024px){
            padding-top: 32px;
            padding-bottom: 50px
        }
    }
    .title-centr{
        .pure-line{
            margin-top: 24px;
            margin-bottom: 80px;
            @media screen and (max-width:1024px) {
                margin-top: 20px;
                margin-bottom: 60px;                
            }
        }
    }
    &__cards{
        display: grid;
        grid-template:repeat(2, 140px) / repeat( 3, 1fr);
        row-gap: 140px;
        column-gap: 30px;    
        @media screen and (max-width:1024px){
            row-gap: 60px;
            column-gap: 20px;
        }
        @media screen and (max-width:800px){
            row-gap: 42x;
            grid-template:repeat(6, 140px) / repeat( 1, 1fr);
        }
        .amazing__card{
            display: flex;
            @media screen and(max-width:800px){
                justify-content: center;                
            }
            .amazing__card-img{
                margin-right: 37px;                    
            }
            .amazing__card-text{
                h4{
                    padding-top: 20px;
                    padding-bottom: 20px;
                    font-style: normal;
                    font-weight: 700;
                    font-size: 24px;
                    line-height: 28px;
                    color: #2D3033;
                    width: 100%;
                    transition: 0.1s ease;
                    @media screen and (max-width:1024px){
                        font-size: 18px;
                        line-height: 21px;
                    }
                }
                p{
                    padding-top: 20px;
                    font-style: normal;
                    font-weight: 400;
                    font-size: 18px;
                    line-height: 21px;
