                    width: 100%;
                    transition: 0.1s ease;
                    @media screen and (max-width:1024px){
                        font-size: 14px;
                        line-height: 16px;
                    }
                    @media screen and (max-width:800px){
                        font-size: 14px;
                        line-height: 16px;
                        padding-top: 5px;
                    }
                }
            }
            &:hover .amazing__card-text *{
                color: black;
                transition: 0.2s;
            }
        }        
    }

}

sources.styles\\banner-welcom.less:
.welcom{
      &__container{
        max-width: 1170px;
        margin: 0 auto;
    }
    &__wrapper{
        display: block;
        margin: 0 15px;
        padding-top: 100px;
        width: 100%;
        height: 100%;
        padding-bottom: 20px;        
        transition: 0.3s ease;
        @media screen and (max-width:700px){
            padding-top: 60px;            
            margin: 0 5px;
        }
    }
    .welcom_active{
        opacity: 0;
        transition: 0.3s;        
        transform: translateX(-100%);
    }
    &__discription{
        h2{
            font-family: @KaushanScript;
            font-style: normal;
            text-align: center;
            font-weight: 400;
            font-size: 64px;
            line-height: 93px;
            color: #Ffffff;
            @media screen and (max-width:1024px){
                font-size: 48px;
                line-height: 70px;
            }
            @media screen and (max-width:700px){
                font-size: 36px;
                line-height: 52px;
            }
        }
    }
    &__title{
        h1{
            font-family: @Montserrat;
            text-align: center;
            font-weight: 700;
            font-size: 144px;
            line-height: 176px;
            color: #Ffffff;
            white-space: pre-line;
            padding-bottom: 44px;
            @media screen and (max-width:1024px){
                font-size: 96px;
                line-height: 117px;
            }
            @media screen and (max-width:700px){
                margin-top: 50px;
                font-size: 48px;
                line-height: 59px;
            }
        }
    }
    &__butn{
        margin: 74px auto 116px auto;
        width: 370px;
        height: 78px;
        @media screen and (max-width:1024px){
            width: 320px;
            height: 52px;
            margin: 50px auto 75px auto;   
        }
        @media screen and (max-width:700px){
            width: 280px;
            height: 50px;
            margin: 50px auto 50px auto;   
        }
        button{
            background: none;
            border: 1px solid #Ffffff;
            color: #Ffffff;
            font-family: @Raleway;
            font-style: normal;
            font-weight: 700;
            font-size: 24px;
            line-height: 28px;
            width: 100%;
            height: 100%;
            @media screen and (max-width:1024px){
                font-size: 18px;
                line-height: 21px;                
            } 
            @media screen and (max-width:700px){                
                border: 3px solid #Ffffff;   
            }
            &:hover{
                background-color: rgba(212, 207, 207, 0.445);
                transition: 0.5s;
            }
        }
    }
    &__progress-bars{
        display: grid;
        width: 100%;
        grid-template:repeat(1, 100%) / repeat( 4 , minmax(150px,22%));
        gap: 30px;
        @media screen and (max-width:1024px){
            gap: 20px;            
        }       
        @media screen and (max-width:700px){
            grid-template:repeat(1, 100%) / repeat(4, minmax(50px, 22%));
            gap: 20px;
        }       
        @media screen and (max-width:580px){
            grid-template:repeat(1, 100%) / repeat(4, minmax(50px, 21%));
            gap: 20px;
        }
        @media screen and (max-width:440px){
            grid-template:repeat(1, 100%) / repeat(4, minmax(50px, 20%));
            gap: 20px;
        }
        @media screen and (max-width:360px){
            grid-template:repeat(1, 100%) / repeat(4, minmax(50px, 19%));
            gap: 20px;
        }

        .progress-card{
            &__bar{
                progress{
                    width: 100%;
                    &[value] {
                        border-radius: 2px;
                        height: 5px;
                        background-color: #4F5A6E;
                    }
                    &[value]::-webkit-progress-bar {
                        border-radius: 2px;
                        background-color: #FFFFFF;
                        height: 5px;
                    }
                    &[value]::-webkit-progress-value {
                        border-radius: 2px;
                        background-color: #F38281;
                        height: 5px;
                    }
                    &[value]::-moz-progress-bar {
                        border-radius: 2px;
                        height: 5px;
                        background-color:#F38281;
                    }
                }
            }
            &__discrp{
                margin-top: 20px;
                span:nth-child(1){
                    font-family: @Raleway;
                    font-style: normal;
                    font-weight: 700;
                    font-size: 36px;
                    line-height: 42px;
                    color: rgba(235, 230, 230, 0.9);
                    @media screen and (max-width:1024px){
                        font-size: 28px;
                        line-height: 36px;
                    }
                    @media screen and (max-width:600px){
                        display: none;
                    }
                 }
                 span:nth-child(2){
                    font-family: @Raleway;
                    font-style: normal;
                    font-weight: 400;
                    font-size: 15px;
                    line-height: 42px;
                    color: rgba(235, 230, 230, 0.9);
                    @media screen and (max-width:1024px){
                        font-size: 12px;
                        line-height: 36px;
                    }                    
                    @media screen and (max-width:600px){
                        display: none;
                    }
                 }
            }
        }
    }
}

sources.styles\\footer.less:
.mogo-foot{
    &__wrapper{
        margin: 42px 15px 0 15px;
        @media screen and(max-width:1024px) {
            margin: 30px 15px 0 15px;      
        }
    }
    &__cards{
        padding-top:35px;
        display: grid;
        grid-template: repeat(1, 1fr)/ repeat(3,350px 460px 250px);
        column-gap: 30px;    
        transition: 0.4s ease;       
        @media screen and(max-width:1150px){            
            padding-top:25px;
            column-gap: 20px;            
            grid-template: repeat(1, 1fr)/ repeat(3,300px 430px 250px);
            transition: 0.4s ease;
        }
        @media screen and(max-width:1024px){            
            padding-top:25px;
            column-gap: 20px;            
            grid-template: repeat(1, 1fr)/ repeat(3,270px 400px 230px);
            transition: 0.4s ease;      
        }
        @media screen and(max-width:980px){   
            grid-template: repeat(1, 1fr)/ repeat(3,250px 350px 200px);
        }
        @media screen and(max-width:900px){           
            grid-template: repeat(1, 1fr)/ repeat(3,200px 300px 180px);
        }
        @media screen and(max-width:800px){           
            grid-template: 370px 1fr 420px / repeat(1,1fr);
            justify-content: center;
        }
        @media screen and(max-width:400px){           
            grid-template: 370px 330px 420px / repeat(1,1fr);
            justify-content: center;
        }
        .foot-card__main{                   
            @media screen and(max-width:650px){     
            justify-content: center;
            }     
            .main-card__logo{ 
                width: 100px;
                margin: 0 auto;
                svg{
                    transition: 0.4s ease;
                    @media screen and(max-width:1024px){     
                        transform: translateX(-15px);      
                        scale: 0.8;
                    }
                }
            }
            p{
                margin-top: 50px;
                color: #C6CBCD;
                font-style: normal;
                font-weight: 400;
                font-size: 18px;
                line-height: 21px;
                @media screen and(max-width:1024px){                    
                    margin-top: 35px;
                    font-size: 14px;
                    line-height: 16px;
                }
                @media screen and(max-width:800px){                 
                    margin-top: 25px;     
                    text-align: center;
                }   
            }
            .main-card__discription{
                width: 100%;
                p{
                    color: #2D3033;
                    font-style: normal;
                    font-weight: 700;
                    font-size: 36px;
                    line-height: 30px;
                    @media screen and(max-width:1024px){
                        font-size: 28px;
                        line-height: 20px;
                    }
                    span{
                        margin-left: 10px;
                        font-style: italic;
                        font-weight: 400;
                        font-size: 18px;
                        line-height: 30px;
                        @media screen and(max-width:1024px){
                            font-size: 12px;
                            line-height: 20px;
                        }
                    }
                    .follow-black{
                        margin: 0;
                        font-style: normal;                        
                        font-weight: 700;
                        color: #2D3033;
                    }
                }
                .footer-main__line{
                    display: block;
                    width: 100%;
                    height: 1px;
                    background-color: #C6CBCD;
                    margin-top: 20px;
                    @media screen and(max-width:1024px){
                        margin-top: 5px;
                    }
                }
            } 
           .main-card__social{
            display: flex;
            margin-top: 12px;
            width: 100%;
                p{
                    margin-top: 5px;
                    font-style: italic;
                    font-weight: 400;
                    font-size: 13px;
                    line-height: 15px; 
                    @media screen and(max-width:1024px){
                        font-size: 12px;
                        line-height: 14px;
                    }              
                }
                .main-social-icons{
                    margin-left: 40px;
                    display: flex;
                    align-items: center;
                    justify-content: end;
                    width: 70%;
                    @media screen and(max-width:1024px){
                        margin-left: 20px;
                    }
                    .foot-card__social{
                        margin: 0 auto;
                        @media screen and(max-width:1024px){
                            scale: 0.7;
                        }
                    }
                }
           }
           form{
            margin-top: 50px;
            max-width: 370px;
            height: 55px;
            display: flex;
            @media screen and(max-width:1024px){
                margin-top: 30px;
                max-width: 315px;
                height: 40px;
                margin: 0 auto;
            }
            @media screen and(max-width:650px){  
                flex-direction: column;             
                margin-top: 20px;                
                height: 100px;
            }  
                input{
                    background-color: #FFFFFF;
                    border: 1px solid #C6CBCD;
                    border-right: 0;
                    height: 100%;
                    width: 100%;
                    @media screen and(max-width:650px){ 
                        border: 1px solid #C6CBCD;
                        height: 40px;
                    }  
                    &::placeholder{
                        color: #C6CBCD;
                        font-style: normal;
                        font-weight: 400;
                        font-size: 18px;
                        line-height: 21px;
                        text-align: center;
                        @media screen and(max-width:1024px){
                            font-size: 14px;
                            line-height: 16px;
                        }
                    }
                }
                button{
                    height: 100%;
                    background-color: #95E1D3;
                    color: #FFFFFF;
                    font-style: normal;
                    font-weight: 700;
                    font-size: 18px;
                    line-height: 21px;
                    border: none;
                    padding: 0 15px;
                    transition: 0.3s ease;
                    @media screen and(max-width:1024px) {
                        font-size: 14px;
                        line-height: 16px;                        
                    }
                    @media screen and(max-width:650px) {
                        margin-top: 20px;  
                        height: 40px;                     
                    }
                    &:hover{
                        background-color: #95e1d37a;
                        transition: 0.5s;
                        color: #75787a;
                    }
                }                
           }          
        }
        .foot-card__blog{
            display: flex;
            flex-direction: column;
            justify-content: end;            
            @media screen and(max-width:1024px) {
                justify-content: start;
            }             
            @media screen and(max-width:650px) {
                margin-top: 20px;
                justify-content: center;                                        
            }  
            h5{
                color: #2D3033;
                font-style: normal;
                font-weight: 700;
                font-size: 24px;
                line-height: 28px;
                margin-bottom: auto;
                @media screen and(max-width:1024px) {
                    font-size: 18px;
                    line-height: 21px;
                    margin-bottom: 20px;
                }
                @media screen and(max-width:800px) {
                    text-align: center;
                }
            }
            .foot-blog__card{
                margin-top: 30px;
                display: flex;
                @media screen and(max-width:1024px) {
                    margin-top: 17px;                                        
                }          
                @media screen and(max-width:329px) {
                    margin-top: 0px;                                        
                }
                .blog-card__img{
                    min-width: 170px;
                    margin-right: 30px;
                    @media screen and(max-width:1024px) {
                        min-width: 130px;
                        margin-right: 20px;                                        
                    }
                    @media screen and(max-width:400px) {
                        min-width: 85px;
                        min-height: 100%;

                    }
                }
                .foot-card__info{
                    p{
                        color: #2D3033;
                        font-style: normal;
                        font-weight: 700;
                        font-size: 18px;
                        line-height: 21px;
                        padding-right: 20px;
                        margin-bottom: 15px;
                        @media screen and(max-width:1024px) {
                            font-size: 14px;
                            line-height: 16px;                            
                            margin-bottom: 10px;                                        
                        }
                        @media screen and(max-width:600px) {
                            font-size: 12px;
                            line-height: 14px;                                        
                        }
                    }
                    span{
                        display: block;
                        color: #2D3033;
                        font-style: normal;
                        font-weight: 400;
                        font-size: 13px;
                        line-height: 15px;
                        @media screen and(max-width:1024px) {
                            font-size: 12px;
                            line-height: 14px;                            
                            margin-bottom: 10px;                                        
                        }
                        @media screen and(max-width:650px) {                           
                            margin-bottom: 10px;                                        
                        }
                    }
                }
            }
        }
        .foot-card__instagram{
            display: flex;
            flex-direction: column;
            @media screen and(max-width:800px){
                margin-bottom: 10px;
            }
            h5{
                color: #2D3033;
                font-style: normal;
                font-weight: 700;
                font-size: 24px;
                line-height: 28px;
                padding-bottom: 16px;
                @media screen and(max-width:1024px){
                    font-size: 18px;
                    line-height: 21px;
                }
                @media screen and(max-width:800px){
                    margin-top: 30px;
                    text-align: center;
                }
            }
            .foot-inst__imges{    
                display: grid;
                grid-template: repeat(3,1fr) / repeat(3, 1fr);            
                margin-top: 26px;
                @media screen and(max-width:1024px){
                    margin-top: 20px;
                    grid-template: repeat(3,70px) / repeat(3, 70px); 
                }
                @media screen and(max-width:800px){
                    justify-content: center;
                    grid-template: repeat(3,90px) / repeat(3, 90px); 
                }
                img{
                    transition: 0.5s ease;
                    @media screen and(max-width:800px){
                        width: 100%;
                        height: 100%;
                    }
                    &:hover{
                        scale: 1.1;
                        transition: 0.5s;
                    }
                }
            }
            p{
                color: #2D3033;
                margin-top: 35px;
                border-bottom: 1px solid #C6CBCD;
                font-style: normal;
                font-weight: 400;
                font-size: 13px;
                line-height: 15px;
                width: 110px;
                @media screen and(max-width:1024px){
                    font-size: 12px;
                    line-height: 14px;
                }
                @media screen and(max-width:800px){
                    text-align: center;
                    margin: 35px auto 0 auto;
                }
            }
        }
    }    
    hr{
        margin-top: 42px;
        @media screen and(max-width:1024px) {
            margin-top: 24px;            
        }
    }
    .footer__end-text{
        display: flex;
        align-items: center;
        justify-content: center;
        width: 100%;
        color: #2D3033;
        font-style: normal;
        font-weight: 700;
        font-size: 13px;
        line-height: 15px;
        padding: 15px 0;
        @media screen and(max-width:800px){
            text-align: center;            
        }
    }
}

