                padding: 0;
                cursor: pointer;
                background: transparent;
                border: none;
                justify-content: space-between;
                transition: all ease-in-out 0.3s;
                &:hover{
                    scale: 1.1;
                }
                span{
                    width: 100%;
                    height: 3px;
                    background: #FFFFFF;
                    transition: transform .5s, opacity .5s, background-color 0.5s;                
                }
            }
        }         
    }
    &__item{
        width: 114px;
        height: 100px;
        @media screen and (max-width:1024px){
            scale: 0.9;
