            color: #FFFFFF;
            font-family: @Raleway;
            font-weight: 600;
            font-size: 14px;
            line-height: 16px;
            span:hover{
                text-align: center;
                width: 100px;
                color: #F4BF87;
                padding-bottom: 5px;
                border-bottom: 1px solid #F4BF87;
                transition: 0.2s;
                @media screen and (max-width:1024px){
                    width: 80px;
                }
            }
        }       
    }
    &__logo{
        display: flex;
        flex-direction: column;
        justify-content: center;
        align-items: center;
        span{
            -webkit-transition: 0.5s ease;
            @media screen and (max-width:1024px){
                svg{
                    scale: 0.8;
                    transition: 0.3s ease;
                }  
            }
            @media screen and(max-width:800px) {
                margin-top: 25px;        
            }
        }
        span:hover{
            padding: 20px;
            transition: 0.5s;
            border: 1px solid #F4BF87;
            border-radius: 100%;
            @media screen and(max-width:1024px) {
                border: none;                
                padding: 0;

            }
