                fill: #F4BF87;
                transition: 0.3s;
            }
        }

    }
    .icon-last{
        padding-left: 15px;
    }
    &__item-icon{
        display: flex;
        flex-direction: column;
        justify-content: center;
        align-items: center;
        margin-left: 15px;
        span:hover{
            padding-bottom: 5px;
            transition: 0.3s;
            border-bottom: 1px solid #F4BF87;
            .header-svg-icon path{
            fill: #F4BF87;
            cursor: pointer;
            transition: 0.1s;
            }
        }
        @media screen and (max-width:1024px){
            scale: 0.9;
        }
        @media screen and (max-width:800px) {
            display: none;            
        }
