        justify-content: center;
        @media screen and (max-width:1024px){
            margin:60px 15px;
        }        
        @media screen and (max-width:800px){            
            padding:0;
            margin:55px 15px 40px 15px;           
         }
    }
    &__main{
        display: flex;        
        align-items: center;
        justify-content: center;
        .slider-main__photo{
            margin-right: 30px;
            min-width: 150px;
            min-height: 150px;
            @media screen and (max-width:1024px){
                min-width: 115px;
                min-height: 115px;
            }
            @media screen and (max-width:800px){
                width: 115px;
                height: 115px;
                margin-bottom: 40px;
            }
        }
        .slider-main__body{
            p{
                color: #A9AFB1;
                font-style: italic;
                font-weight: 500;
                font-size: 24px;
                line-height: 28px;
                @media screen and (max-width:1024px){
                    font-size: 18px;
                    line-height: 21px;
                }
                @media screen and (max-width:1024px){
                    font-size: 14px;
                    line-height: 16px;
                }
            }
            .slider-body__person-name{
                display: flex;
                align-items: center;
                margin-top: 21px;
                span{
                    margin-bottom: 20px;
                }
                h5{
                    margin: 0 0 0 56px;
                    font-family: @KaushanScript;
                    font-style: normal;
                    font-weight: 400;
                    font-size: 30px;
                    line-height: 44px;
                    @media screen and (max-width:1024px){
                        font-size: 24px;
                        line-height: 35px;
                    }
                    @media screen and (max-width:800px){
                        font-size: 18px;
                        line-height: 26px;
                        padding-bottom: 15px;
                    }
                }
            }
            .reviews__slaid-btns{
                display: none;
                flex-direction: row;
                .slaid-btn{
                    display: none;
                  }
                .slaid-btn + label::before{  
                    content: "";
                    display: block;  
                    width: 10px;
                    height: 10px;
                    border: 1px solid #86878B;
                    border-radius: 50%;
                    margin: 10px;
                  }
                  .slaid-btn:checked + label::before{
                    background-color: #86878B;
                  }
                @media screen and (max-width:800px){
                    display: flex;
                    justify-content: center; 
                    margin-top: 25px;        
                }
            }

        }        
        @media screen and (max-width:800px){
            flex-direction: column;           
         }
    }
    &__sw-left{       
        display: flex;
        align-items: center;
        justify-content: center;
        padding-right: 10px;
        width: 50px;
        height: 50px;
        margin-right: 45px;
        border-radius: 30%;        
        transition: 0.5s ease;
        @media screen and (max-width:1024px) {
            scale: 0.8;                    
        }
        @media screen and (max-width:800px){
            display: none;            
        }
        &:hover{
            transition: 0.5s;
            box-shadow: -5px 5px 3px rgba(131, 128, 128, 0.37) ;
        }
    }
    &__sw-right{        
        display: flex;
        align-items: center;
        justify-content: center;
        padding-left: 10px;
        width: 50px;
        height: 50px;
        margin-left: 45px;
        border-radius: 30%;        
        transition: 0.5s ease;
        @media screen and (max-width:1024px) {
            scale: 0.8;                    
        }        
        @media screen and (max-width:800px){
            display: none;            
        }
        &:hover{
            transition: 0.5s;
            box-shadow: 5px 5px 3px rgba(131, 128, 128, 0.37) ;
        }
    }
}

