        display: flex;
        justify-content: center;
        align-items: center;
        font-family: @KaushanScript;
        font-style: normal;
        font-weight: 400;
        font-size: 30px;
        line-height: 44px;
        height: 80px;
        color: #2D3033;
        @media screen and (max-width:1024px){
            font-size: 24px;
