.title-centr{
    width: 100%;
    h2{
        display: flex;
        justify-content: center;
        align-items: center;
        font-style: normal;
        font-weight: 900;
        font-size: 36px;
        line-height: 42px;
        height: 81px;
        color: #2D3033;
        @media screen and (max-width:1024px){
            font-size: 24px;
            line-height: 28px;
            height: 61px;
        }
