            height: 50px;
        }
    }
}
.discription-centr{
    width: 100%;
    margin-bottom: 80px;
    p{
        text-align: center;            
        font-weight: 400;
        font-size: 18px;
        line-height: 21px;
        color: #2D3033;
        @media screen and (max-width:1024px){
            font-size: 14px;
            line-height: 16px;
        }
    }
    @media screen and (max-width:1024px){
        margin-bottom: 60px;
    }
    @media screen and (max-width:800px){
        margin-bottom: 30px;
    }
}
.short-span{
    display: block;
    width: 70px;
    height: 4px;
